import React, { useEffect } from 'react';
import { Link } from 'react-router-dom';
import './Signup.scss';

function Signup() {
  useEffect(() => {
    const inputs = document.querySelectorAll('input');

    const handleFocus = (event) => {
      event.target.previousElementSibling.classList.add('active', 'highlight');
    };

    const handleBlur = (event) => {
      const label = event.target.previousElementSibling;
      label.classList.remove('highlight');
      if (event.target.value === '') label.classList.remove('active');
    };

    const handleInput = (event) => {
      const label = event.target.previousElementSibling;
      event.target.value !== '' ? label.classList.add('active') : label.classList.remove('active');
    };

    inputs.forEach((input) => {
      input.addEventListener('focus', handleFocus);
      input.addEventListener('blur', handleBlur);
      input.addEventListener('input', handleInput);
    });

    return () => {
      inputs.forEach((input) => {
        input.removeEventListener('focus', handleFocus);
        input.removeEventListener('blur', handleBlur);
        input.removeEventListener('input', handleInput);
      });
    };
  }, []);

  return (
    <div className="form">
      <ul className="tab-group">
        <li className="tab active">
          <Link to="/signup">Sign Up</Link>
        </li>
        <li className="tab">
          <Link to="/login">Log In</Link>
        </li>
      </ul>
      <div className="tab-content">
        <div id="signup">
          <h1>Sign Up for Free</h1>
          <form action="/" method="post">
            <div className="field-wrap">
              <label htmlFor="username">
                Username<span className="req">*</span>
              </label>
              <input type="text" id="username" required autoComplete="off" />
            </div>
            <div className="field-wrap">
              <label htmlFor="email">
                Email Address<span className="req">*</span>
              </label>
              <input type="email" id="email" required autoComplete="off" />
            </div>
            <div className="field-wrap">
              <label htmlFor="password">
                Set A Password<span className="req">*</span>
              </label>
              <input type="password" id="password" required autoComplete="off" />
            </div>
            <button type="submit" className="button button-block">Get Started</button>
          </form>
        </div>
        <div id="login">
          <h1>Welcome Back!</h1>
          <form action="/" method="post">
            <div className="field-wrap">
              <label htmlFor="loginEmail">
                Email Address<span className="req">*</span>
              </label>
              <input type="email" id="loginEmail" required autoComplete="off" />
            </div>
            <div className="field-wrap">
              <label htmlFor="loginPassword">
                Password<span className="req">*</span>
              </label>
              <input type="password" id="loginPassword" required autoComplete="off" />
            </div>
            <p className="forgot"><Link to="#">Forgot Password?</Link></p>
            <button className="button button-block">Log In</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Signup;
